Shameless is an American television comedy-drama which airs on Showtime. This remake of the award-winning British series is set in Chicago's Canaryville[1] neighborhood on the South Side, although filmed in Los Angeles, with the exterior scenes filmed in Chicago.[2] The series premiered on January 9, 2011.[3] The show's second season, which began shooting on July 5, 2011[4] premiered on Sunday, January 8, 2012.[5] On February 1, 2012, the series was renewed for a third season,[6] which began shooting on June 27, 2012[7] and premiered on Sunday, January 13, 2013.[8] On January 29, 2013, Showtime renewed Shameless for a fourth season,[9] which premiered on January 12, 2014. On February 18, 2014, Showtime renewed Shameless for a fifth season.


